const Persons = ({persons, searchTerm, handleDelete}) => {
    return (
        <ul>
            {persons.filter(person => 
                person.name.toLowerCase().includes(searchTerm.toLowerCase())).map((person, index) =>
                <li key={person.name}>
                    <div>{person.name} {person.number}</div>
                    <button onClick={(event) => handleDelete(event, index)}>delete</button>
                </li>
            )}
        </ul>
    )
}

export default Persons
